import React, {Component} from "react";

class SOSO extends Component {
    constructor() {
        super();
        this.state = {
            title:[]
        }
    }
    async componentDidMount() {
        const title = await this.$axios.get('/api/index/get?_t=1588174976854&');
        this.setState({
            title:title.data.data.category[0].item.map(v=>{
                return v
            })
        })
    }
    render() {
        return (
            <div>
            {
                this.state.title.map((v,i)=>{
                    return (<div key={i} className={"SOSOdiv"}>  <img alt={"标本"} src={v.image} /><span>{v.title}</span></div>)
                })

            }
            </div>
        )
    }

}

export default SOSO;
